import { View, Text, StyleSheet } from 'react-native';
import { TouchableOpacity } from 'react-native-gesture-handler';

function addchat() {
  return (
    <View style={styles.container}>
      <Text style={styles.title}>Add chat</Text>


    </View>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
